    const _max = (a, b) => Math.max(a, b);
    const _min = (a, b) => Math.min(a, b);

    // Get N/S/E/W ends values
    const n = ys.reduce(_min, 91);
    const s = ys.reduce(_max, 0);
    const e = xs.reduce(_max, 0);
    const w = xs.reduce(_min, 181);

    const ends = { n, s, e, w };
